import Vue from "vue";
import App from "./App.vue";
import VueToast2 from "vue-toast2";


// Add the type declaration for 'vue-toast2'
// declare module 'vue-toast2'; // Remove this line

Vue.use(VueToast2);

new Vue({
    render: (h) => h(App),
}).$mount("#app");
